INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (1, 130011, "ヤマト", "2030/01/01 14:59:59", 2.1, "2024/10/31 12:00:00", 0.0, 3001100, 100, 2, -416.5, 3001, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (4, 130011, "ヤマト", "2030/01/01 14:59:59", 5.68, "2024/10/31 12:00:00", 0.0, 3001101, 101, 2, -416.5, 3001, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (1, 130011, "ヤマト", "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 0.0, 3001102, 102, 1, -416.5, 3001, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (1, 130211, "フブキ", "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 0.0, 3002100, 100, 1, -416.5, 3002, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (1, 130211, "フブキ", "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 0.0, 3002101, 101, 1, -416.5, 3002, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (5, 130211, "フブキ", "2030/01/01 14:59:59", 8.53, "2024/10/31 12:00:00", 0.0, 3002102, 102, 2, -416.5, 3002, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (7, 130211, "フブキ", "2030/01/01 14:59:59", 5.67, "2024/10/31 12:00:00", 0.0, 3002103, 103, 1, -416.5, 3002, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (1, 130211, "フブキ", "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 0.0, 3002104, 104, 1, -416.5, 3002, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3, 130211, "フブキ", "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 0.0, 3002300, 300, 3, -416.5, 3004, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (7, 130211, "フブキ", "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 0.0, 3002400, 301, 7, -416.5, 3005, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (2, 130211, "フブキ", "2030/01/01 14:59:59", 4.4, "2024/10/31 12:00:00", 0.0, 3003200, 200, 1, -416.5, 3003, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (7, 130211, "フブキ", "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 0.0, 3003201, 201, 7, -416.5, 3003, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (1, 130211, "フブキ", "2030/01/01 14:59:59", 5.6, "2024/10/31 12:00:00", 0.0, 3003202, 202, 2, -416.5, 3003, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪");
